    DETERMINISTIC
BEGIN
    DECLARE cesareas INT;
    DECLARE partos_naturales INT;
    DECLARE resultado TEXT;

    -- Contar el número de cesáreas
    SELECT COUNT(*) INTO cesareas
    FROM nacimiento_bebes
    WHERE tipo_nacimiento = 1;

    -- Contar el número de partos naturales
    SELECT COUNT(*) INTO partos_naturales
    FROM nacimiento_bebes
    WHERE tipo_nacimiento = 0;

    -- Concatenar los resultados en una cadena de texto
    SET resultado = CONCAT('Cesáreas: ', cesareas, ', Partos Naturales: ', partos_naturales);

    RETURN resultado;
END ;;
