    DETERMINISTIC
BEGIN
     DECLARE v_curp CHAR(18) DEFAULT NULL;
     DECLARE v_sexo CHAR(1) DEFAULT NULL;
     DECLARE v_efn  CHAR(2) DEFAULT NULL;  /*Entidad Federativa de Nacimiento*/
     DECLARE v_dv   CHAR(2) DEFAULT NULL;  /* Dígito Verificador */
     IF v_genero = "M" THEN 
