     ELSEIF v_entidad_federativa = "Hidalgo" THEN
		SET v_efn = "HG";
	 ELSEIF v_entidad_federativa = "Jalisco" THEN
		SET v_efn = "JC";
     ELSEIF v_entidad_federativa = "México" THEN
