CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_insertar_nacimientos_bebes`(v_cantidad INT)
BEGIN
    DECLARE i INT DEFAULT 1;
    
    
        DECLARE v_fecha_nacimiento DATE;
        DECLARE v_hora_nacimiento TIME;
        DECLARE V_lugar_nacimiento varchar(100);
        DECLARE v_peso DECIMAL(5,2);
        DECLARE v_longitud DECIMAL(5,2);
        DECLARE v_nombre_padre VARCHAR(100);
        DECLARE v_nombre_madre VARCHAR(100);
        DECLARE v_telefono_contacto VARCHAR(20);
        DECLARE v_email_contacto VARCHAR(100);
        DECLARE v_observaciones TEXT;
        DECLARE v_tipo_nacimiento TINYINT;
        DECLARE v_frecuencia_cardiaca INT;
        DECLARE v_temperatura DECIMAL(4,2);
        DECLARE v_presion_arteria_sistolica INT;
        DECLARE v_presion_arteria_diastolica INT;
        DECLARE v_sexo VARCHAR(10);  -- Agregamos la variable para el sexo
        
        WHILE(i <= v_cantidad) DO
        -- Generar datos aleatorios para los campos de la tabla nacimientos_bebes
        SET v_fecha_nacimiento = DATE_ADD('2000-01-01', INTERVAL FLOOR(RAND() * (DATEDIFF('2024-12-31', '2000-01-01') + 1)) DAY);
        SET v_hora_nacimiento = CONCAT_WS(':', LPAD(FLOOR(RAND() * 24), 2, '0'), LPAD(FLOOR(RAND() * 60), 2, '0'), LPAD(FLOOR(RAND() * 60), 2, '0'));
        SET v_peso = RAND() * 5 + 2.5; -- Entre 2.5 y 7.5 kg
        SET v_longitud = RAND() * 0.5 + 0.3; -- Entre 0.3 y 0.8 metros
        SET v_nombre_padre = CONCAT('Padre', LPAD(FLOOR(RAND() * 100) + 1, 3, '0'));
        SET v_nombre_madre = CONCAT('Madre', LPAD(FLOOR(RAND() * 100) + 1, 3, '0'));
        SET v_telefono_contacto = CONCAT('+1-555-', LPAD(FLOOR(RAND() * 1000), 3, '0'), '-', LPAD(FLOOR(RAND() * 10000), 4, '0'));
        SET v_email_contacto = CONCAT('email', LPAD(i, 3, '0'), '@gmail.com');
        SET v_observaciones = CONCAT('Observaciones del nacimiento número ', i);
        SET v_tipo_nacimiento = FLOOR(RAND() * 2); -- 0 para natural, 1 para cesárea
        SET v_frecuencia_cardiaca = FLOOR(RAND() * 150) + 100; -- Entre 100 y 250 lpm
        SET v_temperatura = RAND() * 1 + 36.5; -- Entre 36.5 y 37.5 grados Celsius
        SET v_presion_arteria_sistolica = FLOOR(RAND() * 40) + 70; -- Entre 70 y 110 mmHg
        SET v_presion_arteria_diastolica = FLOOR(RAND() * 40) + 40; -- Entre 40 y 80 mmHg
       
		SET V_lugar_nacimiento = 
			CASE FLOOR(RAND() * 4)
				WHEN 0 THEN 'Xicotepec'
				WHEN 1 THEN 'Huachinango'
				WHEN 2 THEN 'Necaxa'
				ELSE 'Villa Avila Camacho'
			END;
        
        
        
        -- Determinar aleatoriamente el sexo del bebé
        IF FLOOR(RAND() * 2) = 0 THEN
            SET v_sexo = 'Masculino';
        ELSE
            SET v_sexo = 'Femenino';
        END IF;
        
        -- Insertar datos en la tabla nacimientos_bebes
        INSERT INTO api_nacimientosbebes (fecha_nacimiento, hora_nacimiento,lugar_nacimiento, peso, longitud, nombre_padre, nombre_madre, telefono_contacto, email_contacto, observaciones, tipo_nacimiento, frecuencia_cardiaca, temperatura, presion_arterial_sistolica, presion_arterial_diastolica, sexo)
        VALUES (v_fecha_nacimiento, v_hora_nacimiento,v_lugar_nacimiento, v_peso, v_longitud, v_nombre_padre, v_nombre_madre, v_telefono_contacto, v_email_contacto, v_observaciones, v_tipo_nacimiento, v_frecuencia_cardiaca, v_temperatura, v_presion_arteria_sistolica, v_presion_arteria_diastolica, v_sexo);
        
        SET i = i + 1;
    END WHILE;
END ;;
DELIMITER ;
